import React from "react";
import Aboutsecond from "./Aboutsecond";
import Aboutfirst from "./Aboutfirst";
import Aboutthird from "./Aboutthird";
import Aboutfourth from "./Aboutfourth";

const Aboutus = () => {
  return (
    <>
    <Aboutfirst/>
      <Aboutsecond/>
      <Aboutthird/>
      <Aboutfourth/>
    </>
  );
};

export default Aboutus;
